public int active()
{
    int ret;

    ret = super();

    if (projValProjCategoryTable.GroupId)
    {
        projGroup_GroupId.value(projValProjCategoryTable.GroupId);
        projGroup_CategoryId.value(SysQuery::valueEmptyString());
        projGroup_ProjId.value(SysQuery::valueNotEmptyString());

        projNotGroup_GroupId.value(projValProjCategoryTable.GroupId);
        projNotGroup_CategoryId.value(SysQuery::valueEmptyString());
        projNotGroup_ProjId.value(SysQuery::valueNotEmptyString());

        categoryGroup_GroupId.value(projValProjCategoryTable.GroupId);
        categoryGroup_ProjId.value(SysQuery::valueEmptyString());
        categoryGroup_CategoryId.value(SysQuery::valueNotEmptyString());

        categoryNotGroup_GroupId.value(projValProjCategoryTable.GroupId);
        categoryNotGroup_ProjId.value(SysQuery::valueEmptyString());
        categoryNotGroup_CategoryId.value(SysQuery::valueNotEmptyString());
        if (isConfigurationkeyEnabled(configurationKeyNum(Project)))
        {
            m_qbrProjInvoiceGroup_GroupId.value(projValProjCategoryTable.GroupId);
            m_qbrProjInvoiceGroup_CategoryId.value(SysQuery::valueEmptyString());
            m_qbrProjInvoiceGroup_ProjId.value(SysQuery::valueEmptyString());

            m_qbrProjInvoiceNotGroup_GroupId.value(projValProjCategoryTable.GroupId);
            m_qbrProjInvoiceNotGroup_CategoryId.value(SysQuery::valueEmptyString());
            m_qbrProjInvoiceNotGroup_ProjId.value(SysQuery::valueEmptyString());
        }
    }
    else
    {
        projGroup_GroupId.value(SysQuery::valueNotEmptyString());
        projGroup_CategoryId.value(SysQuery::valueEmptyString());
        projGroup_ProjId.value(SysQuery::valueEmptyString());

        projNotGroup_GroupId.value(SysQuery::valueEmptyString());
        projNotGroup_CategoryId.value(SysQuery::valueEmptyString());
        projNotGroup_ProjId.value(SysQuery::valueEmptyString());

        categoryGroup_GroupId.value(SysQuery::valueNotEmptyString());
        categoryGroup_ProjId.value(SysQuery::valueEmptyString());
        categoryGroup_CategoryId.value(SysQuery::valueEmptyString());

        categoryNotGroup_GroupId.value(SysQuery::valueEmptyString());
        categoryNotGroup_ProjId.value(SysQuery::valueEmptyString());
        categoryNotGroup_CategoryId.value(SysQuery::valueEmptyString());

        if (isConfigurationkeyEnabled(configurationKeyNum(Project)))
        {
            m_qbrProjInvoiceGroup_GroupId.value(SysQuery::valueNotEmptyString());
            m_qbrProjInvoiceGroup_CategoryId.value(SysQuery::valueEmptyString());
            m_qbrProjInvoiceGroup_ProjId.value(SysQuery::valueEmptyString());

            m_qbrProjInvoiceNotGroup_GroupId.value(SysQuery::valueEmptyString());
            m_qbrProjInvoiceNotGroup_CategoryId.value(SysQuery::valueEmptyString());
            m_qbrProjInvoiceNotGroup_ProjId.value(SysQuery::valueEmptyString());
        }
    }

    return ret;
